import React, { useState } from 'react';
import { Link } from 'react-router-dom';

import { Container } from './style';

const Consulta: React.FC = () => {
  return (
    <Container>
        <h1 className='Titulo'>
            Consulta
        </h1>
        <br />
        <Link to='/'>
            Voltar para a Home.
        </Link>
    </Container>
  );
}

export default Consulta;
